INSERT INTO `sales` (`sId`, `vId`, `getId`, `sTitle`, `sContent`, `sCoupon`, `sImg`, `sMethod`, `sCount`, `sDate`) VALUES
('S001', 'V001', '26', 'Tandem 假期特賣 - 加碼週\r\n前十組會員折價一百元', '大家好，\r\nTandem  Store 假期特賣即將進入尾聲，\r\n我們決定再加碼十組會員商品折抵一百元的優惠卷。\r\n\r\n取得方式：點去下方按鈕取得優惠卷\r\n限制：1.必須是本站的會員\r\n            2.每位會員限領一張', '', '', '100', '10', '2020-01-02');
INSERT INTO `sales` (`sId`, `vId`, `getId`, `sTitle`, `sContent`, `sCoupon`, `sImg`, `sMethod`, `sCount`, `sDate`) VALUES
('S002', 'V002', '', 'Epic Games Store假期特賣 - 加碼週', '大家好，\r\n\r\nEpic Games Store 假期特賣即將進入尾聲，但驚奇的 2019 年結束後，我們狂歡依舊。就用加碼週特賣迎接新的一年吧！\r\n\r\n從 1 月 1 日 (美東時間早上 11點) 至 1 月 7 日 (美東時間早上 11點)，以下遊戲將進入特賣：\r\n\r\n《邊緣禁地 3》 - 省35%\r\n《World War Z》 - 省60%\r\n《Metro Exodus》 - 最多省55%\r\n《The Outer Worlds》 - 省25%\r\n《Red Dead Redemption 2》 - 最多省25%\r\n《Control》 - 省33%\r\n《Ancestors:The Humankind Odyssey》 - 省50%\r\n《STAR WARS 絕地：組織殞落》 - 省17%\r\n湯姆克蘭西《火線獵殺：絕境》 - 最多省60%\r\n《Rebel Galaxy Outlaw》 - 省25%\r\n《The Sinking City》 - 省40%\r\n《Outward》 - 省60%\r\n《RUNE II》 - 最高省40%\r\n《Afterparty》 - 省20%\r\n《Metro:Last Light Redux》 - 省75%\r\n《Superliminal》 - 省20%\r\n《陰屍路：The Telltale 決定版合輯（The Telltale Definitive Series）》 - 省50%\r\n《Close to the Sun》 - 省40%\r\n《Slime Rancher》 - 省60%\r\n\r\n現在是補齊去年聖誕節購買清單的完美機會。2020 年要從哪款遊戲玩起呢？', '', '', '90%', '100', '2020-01-02');
INSERT INTO `sales` (`sId`, `vId`, `getId`, `sTitle`, `sContent`, `sCoupon`, `sImg`, `sMethod`, `sCount`, `sDate`) VALUES
('S003', 'V003', '', '對遊戲的狂熱！—活動正式開始 —創作者最愛總集，低價特惠讓你無法抗拒！\r\n', '嗨，大家好：\r\n\r\n我們以超棒的免費遊戲和大作開啟了 2020 年，但我們已經在考慮下一步。 \r\n\r\n我們為什麼要玩遊戲、創作遊戲，享受遊戲？ \r\n\r\n這個答案對我們來說很簡單： 為了對遊戲的熱愛！特別是對於社群內的獨立開發者們。同樣簡單的道理還有：小小團隊、大大願景，以及最棒的遊戲。 \r\n\r\n我們 「為了對遊戲的熱愛」活動即日起開始，為眾多獨立遊戲的提供至多原價 75% 的折扣，包括《Mechwarrior 5》、《Satisfactory》以及《Overcooked》——不過動作要快，因為特賣在美國東部時間 2 月 27 日早上 11 點就結束囉！我們也將開放「創作者精選包」，你可以從最喜愛的創作者所提出的最佳精選中做選擇。首批創作者包括：SplatterCat、Wanderbots 以及 BRKsEDU。自本活動起，這些內容將會出現在我們首頁上的精選輪播。\r\n\r\n我們納入的所有遊戲都是熱情滿載的作品，由天賦驚人的開發者所創作。我們很興奮能夠推出它們，並且在 2020 年中加入更多作品。請記住，Epic 優惠券會在美國東部時間 5 月 1 日凌晨 2:59 到期，所以請務必用它們購買任何我們的特價或全新遊戲。 \r\n\r\n<3\r\n\r\nEpic Games Store 團隊', '', '', '90%', '50', '2020-02-14');
INSERT INTO `sales` (`sId`, `vId`, `getId`, `sTitle`, `sContent`, `sCoupon`, `sImg`, `sMethod`, `sCount`, `sDate`) VALUES
('S004', 'V004', '', 'Epic Games Store 假期特賣 - 快來索取 10 美金 Epic 優惠券、免費遊戲和其他豐富內容！', '大家好，\r\n\r\n年末好久不見囉！Epic 假期特賣已正式開跑囉 - 即日起，從美國東部時間 2019 年 12 月 19 日 11AM 到 2020 年 1 月 1 日 11AM！\r\n\r\n為了開始歡慶特賣活動，首先快去領取一張 10 美金 Epic 優惠券，只要在假期特賣頁面上輕輕一鍵。即可領取 Epic 優惠券，讓您用更多折扣購入期望已久的遊戲。\r\n\r\n接下來是什麼呢？\r\n\r\n若您使用 10 美金 Epic 優惠券購買符合條件的遊戲，您將會再額外獲得 10 美金 Epic 優惠券。在整個活動期間，您將從每次符合條件的購買中收到一張 Epic 優惠券！指定遊戲購買必須最低為 14.99 美金，但不包含預購、遊戲內購、DLC、季票等等之購買上。\r\n\r\n12 天免費遊戲\r\n\r\n從 12 月 19 日開始，我們將會推出每日一款免費遊戲來讓玩家領取並永久擁有。\r\n\r\n記得回來領取每日一款免費遊戲 - 這些不像之前的常規免費遊戲活動，僅 24 小時內開放領取。但別擔心！若您很忙碌或人在外，您可以用手機或移動裝置來領取免費遊戲。用手機的瀏覽器開啟 Epic Games Store 來登入領取每日的免費遊戲。\r\n\r\n來自 Epic Games Store 的節日祝福！\r\n\r\n若您有其他問題或欲知更多詳情，請至 FAQ。沒找到想要的答案嗎？請至線上社群（@EpicGames）', '', '', '80%', '10', '2019-12-20');

